import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Sidebar from './components/Sidebar';
import AdimaAcilanDofler from './components/AdimaAcilanDofler';
import DofAc from './components/DofAc';
import RaporCalistir from './components/RaporCalistir';
import Login from './components/Login';

const App = () => {
    return (
        <Router>
            <div style={{ display: 'flex' }}>
                <Sidebar />
                <div style={{ marginLeft: 240, padding: '20px', width: '100%' }}>
                    <Routes>
                        <Route path="/" element={<AdimaAcilanDofler />} />
                        <Route path="/dof-ac" element={<DofAc />} />
                        <Route path="/rapor-calistir" element={<RaporCalistir />} />
                        <Route path="/login" element={<Login />} />
                    </Routes>
                </div>
            </div>
        </Router>
    );
};

export default App;
